import React from "react";

let g_index;
let u_index;
let procent;
export function sendIndex(global_index, user_index){
    g_index = global_index;
    u_index = user_index;
    console.log('I get: '+g_index+' and '+u_index);
    procent = 100 - (u_index * 100)/g_index;
    console.log('Procent: '+procent);
    
}

export function getProcent(){
    procent = 100 - (u_index * 100)/g_index;
    console.log('I send--------------------------------------------------------: '+procent);
    return procent;
}



export default function Dashboard() {
  return(
    <h2>Dashboard</h2>
  );
}
